import React, { useState } from 'react'
import Layout from '../../components/Layout/Layout'
import axios from 'axios';

const Addreclamation = () => {
  const [titre, setTitre] = useState('');
  const [contenu, setContenu] = useState('');
  const [toastMsg, setToastMsg] = useState(''); 
  const [show, setShow]= useState(false);     

  
  const addReclamation = async (e) => {

    try {
      e.preventDefault()
      const userID = Math.floor(Math.random() * 2)+1;
      const result = await axios.post(`http://localhost:8080/api/reclamation/add/${userID}`,{
        titre: titre,
        contenu: contenu
      });
      
      if(result.status===200){
        setToastMsg('Reclamation added successfully');
        setTitre("")
        setContenu("")
        console.log(result.status)

      }
    } catch (error) {
      console.log(error);
    }
  }
  return (
    <div className='w-full '   >
       {show ? 
       <div id="toast-bottom-right" class="flex items-center w-full max-w-xs p-4 text-gray-500 bg-white rounded-lg shadow dark:text-gray-400 dark:bg-gray-800" role="alert">
       <div class="inline-flex items-center justify-center flex-shrink-0 w-8 h-8 text-blue-500 bg-blue-100 rounded-lg dark:bg-blue-800 dark:text-blue-200">
           <svg class="w-4 h-4" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 18 20">
               <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M15.147 15.085a7.159 7.159 0 0 1-6.189 3.307A6.713 6.713 0 0 1 3.1 15.444c-2.679-4.513.287-8.737.888-9.548A4.373 4.373 0 0 0 5 1.608c1.287.953 6.445 3.218 5.537 10.5 1.5-1.122 2.706-3.01 2.853-6.14 1.433 1.049 3.993 5.395 1.757 9.117Z"/>
           </svg>
           <span class="sr-only">Fire icon</span>
       </div>
       <div class="ml-3 text-sm font-normal">Set yourself free.</div>
       <button type="button" class="ml-auto -mx-1.5 -my-1.5 bg-white text-gray-400 hover:text-gray-900 rounded-lg focus:ring-2 focus:ring-gray-300 p-1.5 hover:bg-gray-100 inline-flex items-center justify-center h-8 w-8 dark:text-gray-500 dark:hover:text-white dark:bg-gray-800 dark:hover:bg-gray-700" data-dismiss-target="#toast-default" aria-label="Close">
           <span class="sr-only">Close</span>
           <svg class="w-3 h-3" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 14 14">
               <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="m1 1 6 6m0 0 6 6M7 7l6-6M7 7l-6 6"/>
           </svg>
       </button>
   </div>
       : null}
      
         <Layout role={1} />
        <div className='w-1/2 m-auto '>
        <form className='w-full' onSubmit={addReclamation}>
        <div class="mb-6">
            <label for="titre" class="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Titre</label>
            <input onChange={(e)=>setTitre(e.target.value)} value={titre}  type="text" id="titre" class="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" placeholder="Entrer le titre de reclamation" required/>
        </div>
        <div class="mb-6">
        <label for="message" class="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Contenu</label>      
        <textarea  onChange={(e)=>setContenu(e.target.value)} value={contenu} id="message" rows="4" class="block p-2.5 w-full text-sm text-gray-900 bg-gray-50 rounded-lg border border-gray-300 focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" placeholder="Ecrire le contenu de votre reclamation..."></textarea>

        </div>
       
        <button type="submit" onClick={setShow()} className="text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:outline-none focus:ring-blue-300 font-medium rounded-lg text-sm w-full sm:w-auto px-5 py-2.5 text-center dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800">Submit</button>
        </form>
        </div>
        

    </div>
  )
}

export default Addreclamation
